(1722, 2, 'heading', '<h5 class=\"media__title title-sub title-exp\">YEARS OF EXPERIENCE</h5>'),
(1723, 2, '_heading', 'field_5cd64e594c1df'),
(1724, 2, 'content', '<p class=\"text--s18-40 m-b-15\">Wir sind ein vielseitiges Werbeatelier spezialisiert in 3dimensionaler Werbung im Bereich: Schaufenster, Inneneinrichtung, POS, Event Anlässe, Messen, Displays und Beschriftungen. Ihre Wünsche setzen wir in eigener Produktion um und helfen Ihnen bei der Konzeption für einen wuchtigen Auftritt. Dauernd auf der Suche nach neuen Ideen, Materialien und Technologien versuchen wir unseren Kunden das neuste auf dem Markt anbieten zu können.</p>\r\n\r\n<table class=\"contenttable contenttable-0 text--s18-40\">\r\n<tbody>\r\n<tr class=\"tr-even tr-0\">\r\n<td class=\"td-0\">Gründungsjahr:</td>\r\n<td class=\"td-1\"></td>\r\n<td class=\"td-last td-2\">01.01.2003</td>\r\n</tr>\r\n<tr class=\"tr-odd tr-1\">\r\n<td class=\"td-0\">Rechtsform:</td>\r\n<td class=\"td-1\"></td>\r\n<td class=\"td-last td-2\">Einzelfirma</td>\r\n</tr>\r\n<tr class=\"tr-even tr-2\">\r\n<td class=\"td-0\">Inhaber:</td>\r\n<td class=\"td-1\"></td>\r\n<td class=\"td-last td-2\">Heiko Cornelsen</td>\r\n</tr>\r\n<tr class=\"tr-odd tr-3\">\r\n<td class=\"td-0\">Mitarbeiter:</td>\r\n<td class=\"td-1\"></td>\r\n<td class=\"td-last td-2\">4</td>\r\n</tr>\r\n<tr class=\"tr-even tr-last\">\r\n<td class=\"td-0\">Geschäftssitz:</td>\r\n<td class=\"td-1\"></td>\r\n<td class=\"td-last td-2\">Uetendorf / BE</td>\r\n</tr>\r\n</tbody>\r\n</table>'),
